const Workout = () => {
  return (
    <>
    <strong>Chest Exercises</strong>
    <Card className="my-3 p-3 rounded">
    <Card.Img src={w1} variant="top" />
    <Card.Body>
            <Card.Title as="div">
              <strong>Incline Chest Press</strong>
            </Card.Title>
          </Card.Body>
        </Card>
        <Card className="my-3 p-3 rounded">
    <Card.Img src={w1} variant="top" />
    <Card.Body>
            <Card.Title as="div">
              <strong>Incline Chest Press</strong>
            </Card.Title>
          </Card.Body>
        </Card>
        <Card className="my-3 p-3 rounded">
    <Card.Img src={w1} variant="top" />
    <Card.Body>
            <Card.Title as="div">
              <strong>Incline Chest Press</strong>
            </Card.Title>
          </Card.Body>
        </Card>
        </>
  )
}

export default Workout
